import createLucideIcon from '../createLucideIcon';

const SkipBack = createLucideIcon('SkipBack', [
  ['polygon', { points: '19 20 9 12 19 4 19 20', key: 'o2sva' }],
  ['line', { x1: '5', y1: '19', x2: '5', y2: '5', key: '1qxvzh' }],
]);

export default SkipBack;
